import { HashLink as Link } from 'react-router-hash-link';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <a className="navbar-brand mx-auto" href="#home">CRM Sistemi</a>
      <div className="collapse navbar-collapse">
        <ul className="navbar-nav ml-auto mx-auto">
          <li className="nav-item">
            <Link to="#home" smooth className="nav-link">Ana Sayfa</Link>
          </li>
          <li className="nav-item">
            <Link to="#about" smooth className="nav-link">Hakkımızda</Link>
          </li>
          <li className="nav-item">
            <Link to="#contact" smooth className="nav-link">İletişim</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
